  false,\n\t\"url\": null,\n\t\"notes\": \"Production of upriver bright fall Chinook
  salmon at Little White Salmon National Fish Hatchery was introduced as part of the
  John Day Dam mitigation program in the early 1980s. Upriver bright fall Chinook
  salmon are not native to the Little White Salmon River basin and are an introduced
  stock for the Lower Columbia River Chinook Evolutionary Significant Unit, as listed
  under the Endangered Species Act. There is concern regarding potential ecological
  effects, especially hatchery introgression effects, if wide spread straying of this
  stock occurs in the Columbia River (USFWS 2004). Objectives of this study were to
  \  determine if hatchery brood stock collection is representative of the hatchery
  return; determine if intermittent ladder openings increase natural spawning and
  straying of Little White Salmon National Fish Hatchery returning adults; and determine
  the final destination of fish not allowed access to the hatchery or selected for
  brood stock.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
